import React from 'react';

const Car = ({children, color}) => {
    return (
        <div style={{color: "white", backgroundColor: "blue", width: "400px", padding: "10px", margin: "5px auto"}}>
            <p> Marque : { children }</p>
            <p> Couleur : { color }</p>
        </div>
    )
}


export default Car;
